import React from "react";
import Link from "next/link";

export const Layout = ({ children }) => {
  return (
    <React.Fragment>
      <header>
        <Link href="/">Podcast</Link>
      </header>
      {children}

      <style jsx>{`
        header {
          color: #fff;
          background: #8756ca;
          padding: 15px;
          text-align: center;
        }

        header a {
          color: #fff;
          text-decoration: none;
        }
      `}</style>
      <style jsx global>{`
        body {
          margin: 0;
          font-family: system-ui;
          background: white;
        }
      `}</style>
    </React.Fragment>
  );
};
